function framerLayerForGuid(guid) {
  for (var framerLayer of framerLayers) {
    if (framerLayer.guid == guid) {
      return framerLayer;
    }
  }
  return null;
}

function framerLayerForName(name) {
	for (var framerLayer of framerLayers) {
		if (framerLayer.name == name) {
      return framerLayer;
    }
  }
  return null;
}

function screenWithId(screenId) {
  var screenIndex = screenIndexForScreenId(screenId);
  return screenAtIndex(screenIndex);
}

function screenIndexForScreenId(screenId) {
  for (var i=0,len=screens.length; i<len; i++) {
    var screen = screens[i];
    if (screen.uid == screenId) {
      return i;
    }
  }
  return -1;
}

function screenIndexForScreenName(screenName) {
    for (var i=0,len=screens.length; i<len; i++) {
      var screen = screens[i];
      if (screen.name == screenName) {
        return i;
      }
    }
    return -1;
}
function screenAtIndex(screenIndex) {
  return screens[screenIndex];
}

function screenHasLayerWithGuid(aScreen, guidToFind) {
  return layersArrayHasLayerWithGuid(aScreen.layers, guidToFind);
}

function layersArrayHasLayerWithGuid(layers, guidToFind) {
    for (var mityaLayer of layers) {
        if (mityaLayer.guid == guidToFind) return true;

    }
    return false;
}

function screenForName(name) {
	for (var screen of screens) {
		if (screen.name == name) {
      return screen;
    }
  }
  return null;
}

function tapActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.tapAction);
}
function touchStartActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.touchStartAction);
}
function touchEndActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.touchEndAction);
}
function mouseOverActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.mouseOverAction);
}
function mouseOutActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.mouseOutAction);
}
function onLoadActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.onLoadAction);
}
function swipeActionInScreenTransition(screenTransition) {
  return (
    horizontalSwipeInScreenTransition(screenTransition) ||
    verticalSwipeInScreenTransition(screenTransition)
  );
}
function horizontalSwipeInScreenTransition(screenTransition) {
  return (
    swipeRightActionInScreenTransition(screenTransition) ||
    swipeLeftActionInScreenTransition(screenTransition)
  );
}
function verticalSwipeInScreenTransition(screenTransition) {
  return (
    swipeUpActionInScreenTransition(screenTransition) ||
    swipeDownActionInScreenTransition(screenTransition)
  );
}
function swipeRightActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.pageSwipeRight);
}
function swipeLeftActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.pageSwipeLeft);
}
function swipeUpActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.pageSwipeUp);
}
function swipeDownActionInScreenTransition(screenTransition) {
  return (screenTransition.action == MAConstants.pageSwipeDown);
}

function transitionsFromTimeline(timeline) {

  var transitions = [];
  for (var timelineLayer of timeline.timelineLayers) {

    if (timelineLayer.animationBands.length == 0) {
      var blankTransition = {};
      blankTransition.targetLayerGuid = timelineLayer.guid;
      blankTransition.isBlankTransition = true;
      transitions.push(blankTransition);
      continue;
    }

    for (var animationBand of timelineLayer.animationBands) {
      for (var transition of animationBand.transitions) {
        var fromKey = transition.keyframes[0];
        var toKey = transition.keyframes[1];
        var transitionData = {};
        transitionData.targetLayerGuid = timelineLayer.guid;
        transitionData.startTime = fromKey.time;
        transitionData.duration = toKey.time - fromKey.time;
        transitionData.animationKey = gsapAnimationKeyForAnimationKey(animationBand.animationKey); 
        transitionData.fromValue = fromKey.parsedValue;
        transitionData.toValue = toKey.parsedValue;
        transitionData.gsapEase = transition.gsapEase;
        transitionData.isActive = transition.active;

        transitions.push(transitionData);
      }
    }

  }
  return transitions;
}

function gsapAnimationKeyForAnimationKey(animationKey) {
    if (animationKey == "left") return "x";
    if (animationKey == "top") return "y";
    if (animationKey == "shadowRadius") return "shadowBlur";
    if (animationKey == "shadowOffsetX") return "shadowX";
    if (animationKey == "shadowOffsetY") return "shadowY";

    if (animationKey == "backgroundColor") return "setProxyBackgroundColor";
    if (animationKey == "borderColor") return "setProxyBorderColor";
    if (animationKey == "shadowColor") return "setProxyShadowColor";
    if (animationKey == "color") return "setProxyColor";
    return animationKey;
}

function framerAnimationKeyForAnimationKey(animationKey) {
    if (animationKey == "left") return "x";
    if (animationKey == "top") return "y";
    if (animationKey == "shadowRadius") return "shadowBlur";
    if (animationKey == "shadowOffsetX") return "shadowX";
    if (animationKey == "shadowOffsetY") return "shadowY";

    if (animationKey == "setProxyBackgroundColor") return "backgroundColor";
    if (animationKey == "setProxyBorderColor") return "borderColor";
    if (animationKey == "setProxyShadowColor") return "shadowColor";
    if (animationKey == "setProxyColor") return "color";

    return animationKey;
}

function arrangeLayersAsPerScreenTransition(screenTransition) {
    if (screenTransition.animation == MAConstants.reverseAnimation) {
        var toScreen = screenWithId(screenTransition.toScreenId);
        attachChildLayersToParent(toScreen.layers, null);
    }
    else {
        attachChildLayersToParentForGroupLayersWithLayerStructureOnlyInDestinationScreen(screenTransition);
    }

    reorderLayersInCorrectZOrderForScreenTransition(screenTransition);
    setPropertiesOfLayersToInitialStateOfScreenTransition(screenTransition);
}

function setPropertiesOfLayersToInitialStateOfScreenTransition(screenTransition) {
    var layerData = screenTransition.framerAndMityaLayersForAllLayersInScreenTransition();
    for (var data of layerData) {
      setFramerLayerPropertiesFromMityaLayer_ScreenTransition(data.framerLayer, data.mityaLayer, screenTransition);
    }
}

function arrangeLayersOnlyInToScreenOfScreenTransition(screenTransition) {

  var toScreen = screenWithId(screenTransition.toScreenId);
  attachChildLayersToParent(toScreen.layers, null);

  var layerData = screenTransition.framerAndMityaLayersForLayersOnlyInToScreen();

  for (var data of layerData) {
    setFramerLayerPropertiesFromMityaLayer_ScreenTransition(data.framerLayer, data.mityaLayer, screenTransition);
  }

  reorderLayersInCorrectZOrderForScreenTransition(screenTransition);
}

function reorderLayersInCorrectZOrderForScreenTransition(screenTransition) {
    var timeline = screenTransition.timelineToUse();
    var i=0;
    for (var timelineLayer of timeline.timelineLayers) {
        var guidToFind = timelineLayer.guid;
        if (screenTransition.type == MAConstants.symbolToSymbolTransition) {
            guidToFind += diyaSymbolSeparator + screenTransition.instanceParent.guid;
        }
        var framerLayer = framerLayerForGuid(guidToFind);
        framerLayer.index = i;
        i++;
    }
}

