function _createLayers(layers) {
  for (var layer of layers) {
    if (layer.isGroup) {
        var childLayers = childLayersOfLayer(layer);
        var groupLayer = createFramerLayerForGroup(layer, childLayers);
    }
    else if (layer.isSymbolInstance) {
        if (layerExistsForGuid(layer.guid)) continue;

        createFramerLayerForSymbolInstance(layer);
    }
    else if (mityaLayerIsTextLayer(layer)) {
        if (layerExistsForGuid(layer.guid)) continue;

        createFramerLayerForTextLayer(layer);
    }
    else if (mityaLayerIsSVGLayer(layer)) {
        if (layerExistsForGuid(layer.guid)) continue;

        createFramerLayerForSVGLayer(layer);
    }
    else {
        if (layerExistsForGuid(layer.guid)) continue;

        createFramerLayerForImage(layer);
    }
  }

  for (var layer of layers) {
      if (layer.isGroup) {
          var childLayers = childLayersOfLayer(layer);
          var groupLayer = getLayer(layer.uid);
          attachChildLayersToParent(childLayers, groupLayer);
      }
  }
}


