function setFramerLayerPropertiesFromMityaLayer(framerLayer, mityaLayer, symbolSuffix) {
    if ( !framerLayer ) {
        if (mityaLayer)
            console.log('framerLayer not found for guid: ' + mityaLayer.name + ' Skipping setFramerLayerPropertiesFromMityaLayer');
        else
            console.log('framerLayer and mityaLayer are empty. Skipping setFramerLayerPropertiesFromMityaLayer');

        return;
    }
    var allKeys = framerLayer.keysToSkipMityaPlacement;
  framerLayer.x = allKeys['x'] ? framerLayer.x : mityaLayer.left;
  framerLayer.y = allKeys['y'] ? framerLayer.y : mityaLayer.top;
  if (!scrollableImageLayer()) {
      framerLayer.width = allKeys['width'] ? framerLayer.width : mityaLayer.width;
      framerLayer.height = allKeys['height'] ? framerLayer.height : mityaLayer.height;
  }

  framerLayer.scale = allKeys['scale'] ? framerLayer.scale : mityaLayer.scale;
  framerLayer.rotation = allKeys['rotation'] ? framerLayer.rotation : mityaLayer.rotation;
  framerLayer.opacity = allKeys['opacity'] ? framerLayer.opacity : mityaLayer.opacity;

    if (mityaLayerIsTextLayer(mityaLayer)) {
        framerLayer.fontSize = mityaLayer.textContent.fontSize;
        framerLayer.fontFamily = mityaLayer.textContent.fontFamily;
        framerLayer.fontStyle = mityaLayer.textContent.fontStyle;
        framerLayer.fontWeight = mityaLayer.textContent.fontWeight;
        framerLayer.color = mityaLayer.textContent.color;
        framerLayer.lineHeight = mityaLayer.textContent.lineHeight;
        framerLayer.textAlign = mityaLayer.textContent.textAlign;
        framerLayer.textDecoration = mityaLayer.textContent.textDecoration;
        framerLayer.textTransform = mityaLayer.textContent.textTransform;
        if (mityaLayer.textContent.letterSpacing != null) {
            framerLayer.letterSpacing = mityaLayer.textContent.letterSpacing;
        }

        var w = framerLayer.width;
        framerLayer.text = parseTextForLists(mityaLayer.textContent.text);
        var offset = textHasList(mityaLayer.textContent.text) ? 50 : 0;
        framerLayer.width = w+offset; 
    }

    if (framerLayer.isSVGLayer) {
        enableAtmaIfLayerIsSVGLayer(framerLayer);

        framerLayer.backgroundColor = '';
        var elementId = '#' + cleanLayerName(framerLayer.name);
        TweenMax.set(elementId, {
            morphSVG:mityaLayer.path,
            fill:mityaLayer.backgroundColor,
            stroke:mityaLayer.borderColor,
            strokeWidth:mityaLayer.borderWidth,
            'stroke-linecap':mityaLayer.borderOptions ? mityaLayer.borderOptions.lineCap : "butt",
            drawSVG:mityaLayer.borderOptions ? mityaLayer.borderOptions.lineDash : "100%"
        });

        TweenMax.set(elementId+MAConstants.svgFilterGaussianBlurSuffix, {attr:{stdDeviation:mityaLayer.shadowRadius}});
        TweenMax.set(elementId+MAConstants.svgFilterOffsetSuffix, {attr:{dx:mityaLayer.shadowOffsetX, dy:mityaLayer.shadowOffsetY}});
        TweenMax.set(elementId+MAConstants.svgFilterFloodSuffix, {attr:{"flood-color":mityaLayer.shadowColor}});
        return;
    }

    framerLayer.shadowColor = mityaLayer.shadowColor;
    framerLayer.shadowOpacity = mityaLayer.shadowOpacity;
    framerLayer.shadowBlur = mityaLayer.shadowRadius; 
    framerLayer.shadowX = mityaLayer.shadowOffsetX;
    framerLayer.shadowY = mityaLayer.shadowOffsetY;

    if (mityaLayer.isSymbolInstance) {
        framerLayer.backgroundColor = ''; 
        enableAtmaIfLayerIsSVGLayer(framerLayer);

        var symbol = symbolWithID(mityaLayer.parentSymbolID);
        if ( !symbol ) {
            console.log('Symbol not found for name: ' + mityaLayer.name + ' Skipping setFramerLayerPropertiesFromMityaLayer');
            return;
        }
        for (var symbolLayer of symbol.layers) {
            var nameToSearch = symbolSuffix ? symbolLayer.name + diyaSymbolSeparator + symbolSuffix : symbolLayer.name + diyaSymbolSeparator + mityaLayer.name;

            var childFramerLayer = framerLayerForGuid(nameToSearch);
            if ( !childFramerLayer ) {
                console.log('framerLayer not found for guid ' + nameToSearch + ' Skipping setFramerLayerPropertiesFromMityaLayer');
                continue;
            }
            if (symbolLayer.isSymbolInstance) {
                if (!symbolSuffix) {
                    setFramerLayerPropertiesFromMityaLayer(childFramerLayer, symbolLayer, symbolLayer.name + diyaSymbolSeparator + mityaLayer.name);
                }
                else {
                    setFramerLayerPropertiesFromMityaLayer(childFramerLayer, symbolLayer, nameToSearch);
                }
            }
            else {
                setFramerLayerPropertiesFromMityaLayer(childFramerLayer, symbolLayer);
            }
            childFramerLayer.superLayer = framerLayer;

            if (mityaLayerIsTextLayer(symbolLayer)) {
                if(symbolLayer.name in mityaLayer.overrides) {
                    childFramerLayer.text = parseTextForLists(mityaLayer.overrides[symbolLayer.name]);

                    if (symbolLayer.textContent.textAlign !== "left") {
                        var xDiff = childFramerLayer.width - symbolLayer.width;
                        childFramerLayer.x = childFramerLayer.x - (xDiff*0.5);
                    }
                }
            }
        }
        for (var override in mityaLayer.overrides) {
            var nameToUse = nameOfNestedSymbolLayer(override, mityaLayer, mityaLayer.name);
            var childFramerLayer = framerLayerForGuid(nameToUse);
            if (childFramerLayer) {
                childFramerLayer.text = parseTextForLists(mityaLayer.overrides[override]);
            }

        }

        return;
    }


  framerLayer.backgroundColor = hideBackgroundColor()  ? '' : mityaLayer.backgroundColor;
  framerLayer.borderRadius = mityaLayer.cornerRadius;
  framerLayer.borderColor = mityaLayer.borderColor;
  framerLayer.borderWidth = mityaLayer.borderWidth;

  function nameOfNestedSymbolLayer(override, mityaLayer, suffix) {
      var symbolMaster = symbolWithID(mityaLayer.parentSymbolID);
      for (var childMityaLayer of symbolMaster.layers) {
          if (mityaLayerIsTextLayer(childMityaLayer)) {
              return override + diyaSymbolSeparator + suffix;
          }
          if (childMityaLayer.isSymbolInstance) {
              return nameOfNestedSymbolLayer(override, childMityaLayer, childMityaLayer.name + diyaSymbolSeparator + suffix);
          }
      }
  }

  function hideBackgroundColor() {
      return mityaLayer.isGroup; 
  }

  function scrollableImageLayer() {
      return !mityaLayer.isGroup && (mityaLayer.horizontalScroll || mityaLayer.verticalScroll);
  }
}

function parseTextForLists(theText) {
    if (textHasList(theText)) {
        return theText.replace(/\t/g, ' ');
    }
    return theText;
}

function textHasList(theText) {
    return (theText.search('\t• \t') > -1) ||
           (theText.search(/\t\d\.\s\t/) > -1) ||
           (theText.search('\t•\t') > -1) ||
           (theText.search(/\t\d\.\t/) > -1);
}

function setFramerLayerZIndex(framerLayer, zIndex) {
  framerLayer ? framerLayer.index = zIndex : 0;
}

function createFramerTimeline(framerLayer, mityaLayer) {

  if (mityaLayer.screenTransitions) {

    framerLayer.framerTimeline = new MAFramerTimeline({
      framerLayer:framerLayer,
      screenTransition:mityaLayer.screenTransitions[0],
      screenTransitions:mityaLayer.screenTransitions
    });
  }
}

function createScreenTransitionManager(framerLayer, mityaLayer) {


  if (mityaLayer.isSymbolInstance) {
      createScreenTransitionManagersForChildLayers(framerLayer, mityaLayer);
  }
  if (mityaLayer.screenTransitions) {
    enableFramerLayer(framerLayer);
    var interactionLayer = layerToInteract(framerLayer)

    if ('screenTransitionManager' in interactionLayer) {
      interactionLayer.screenTransitionManager.setScreenTransitionsDataFromMityaLayer(mityaLayer);
    }
    else {
      interactionLayer.screenTransitionManager = new MAScreenTransitionManager({
        framerLayer:interactionLayer,
        mityaLayer:mityaLayer
      });
    }
  }
}

function layerToInteract(framerLayer) {
  if (framerLayer.scroll) {
      return framerLayer._children[0];
  }
  else if (framerLayer.isSVGLayer) {
      return framerLayer.atmaLayer;
  }

  return framerLayer;

}


function createScreenTransitionManagersForChildLayers(framerLayer, mityaLayer, suffix) {
  var symbol = symbolWithID(mityaLayer.parentSymbolID);
  if ( !symbol ) {
      console.log('Symbol not found for : ' + mityaLayer.name);
      return;
  }
  for (var childLayer of symbol.layers) {
      if (childLayer.isSymbolInstance) {
          var suffixToUse = suffix ? mityaLayer.guid + diyaSymbolSeparator + suffix : mityaLayer.guid;
          createScreenTransitionManagersForChildLayers(null, childLayer, suffixToUse);
      }
      else if (childLayer.screenTransitions) {
          var suffixToUse = suffix ? mityaLayer.guid + diyaSymbolSeparator + suffix : mityaLayer.guid;
          var guid = childLayer.guid + diyaSymbolSeparator + suffixToUse;
          var instanceFramerLayer = framerLayerForGuid(guid);
          var interactionLayer = layerToInteract(instanceFramerLayer);
          if ('screenTransitionManager' in instanceFramerLayer) {
              instanceFramerLayer.screenTransitionManager.setScreenTransitionsDataFromMityaLayer_instanceParent(childLayer, mityaLayer);
          }
          else {
              instanceFramerLayer.screenTransitionManager = new MAScreenTransitionManager({
                framerLayer:interactionLayer,
                mityaLayer:childLayer,
                instanceParent:mityaLayer
              });
          }
      }
  }


}


function attachUserCodeToFramerLayer(framerLayer, userCodes) {
  for (var userCode of userCodes) {
    var event = framerEventForEventName(userCode.event);
    var code = userCode.code;
    var codeAsFunction = Function(code);

    framerLayer.on(event, codeAsFunction);
  }
}

function framerEventForEventName(eventName) {
  switch(eventName) {
    case MAConstants.tapAction:
      return Events.Click;
    case MAConstants.touchStartAction:
      return Events.TouchStart;
    case MAConstants.touchEndAction:
      return Events.TouchEnd;
    case MAConstants.mouseOverAction:
      return Events.MouseOver;
    case MAConstants.mouseOutAction:
      return Events.MouseOut;
  }
}

function runScreenEnterUserCodeForScreenAtIndex(screenIndex) {
  var screen = screenAtIndex(screenIndex);
  try {
    CoffeeScript.run(screen.userCodeOnEnter);
  } catch(e) {
    console.log('user script error' + e.stack + ' line no: ' + e.lineNumber + '...' + e.columnNumber + '...'+ e.message);
    errorDialog.showMessageForScreenName(e.message, screen.name);
  }
}

function runUserCodeOnFramerLayerFromMityaLayer(framerLayer, mityaLayer) {
    try {
        if (mityaLayer.userCode.length > 0) {
            var code = mityaLayer.userCode.replace(new RegExp('\\bthis\\b', 'g'), mityaLayer.jsVariableName);
            code = code.replace(new RegExp('@', 'g'), mityaLayer.jsVariableName+'.');
            CoffeeScript.eval(code);
        }
    } catch(e) {
      console.log('user script error: ' + e + ' mityaLayer:', mityaLayer.name + '\n\ncode:\n' + mityaLayer.userCode);
      var parentScreen = screenWithId(mityaLayer.parentScreenUid);
      var msg = 'Layer: ' + mityaLayer.name + ' in Screen: ' + parentScreen.name;
      errorDialog.showMessageForScreenName(e.message, msg);
    }
}

function runUserCodeForLayers() {
    for (var obj of layersWithUserCode) {
        runUserCodeOnFramerLayerFromMityaLayer(obj.framerLayer, obj.mityaLayer);
    }
}

function runOnLoadAnimationIfAny(screenIndex) {
    var screen = screenAtIndex(screenIndex);
    for (var mityaLayer of screen.layers) {
        if ('screenTransitions' in mityaLayer) {
            for (var st of mityaLayer.screenTransitions) {
                if (st.action == MAConstants.onLoadAction) {
                    var framerLayer = framerLayerForGuid(mityaLayer.guid);
                    var interactionLayer = layerToInteract(framerLayer);
                    var timeoutDuration = prototypeFirstTimeLoad ? 1000 : 0;
                    setTimeout(interactionLayer.play.bind(interactionLayer), timeoutDuration); 
                }
            }
        }
    }

    var symbolInstances = screen.layers.filter(symbolFilter);
    for (var symbolInstance of symbolInstances) {
        runOnLoadAnimationIfAnyForSymbolInstance(symbolInstance);
    }
}

function runOnLoadAnimationIfAnyForSymbolInstance(symbolInstance) {
    var parentSymbol = symbolWithID(symbolInstance.parentSymbolID);
    if ( !parentSymbol )
        return;

    var layersWithAnimation = parentSymbol.layers.filter(onLoadAnimationsFilter);
    for (var layer of layersWithAnimation) {
        var guidToFind = layer.guid + diyaSymbolSeparator + symbolInstance.guid;
        var instanceFramerLayer = framerLayerForGuid(guidToFind);
        var interactionLayer = layerToInteract(instanceFramerLayer);
        var timeoutDuration = prototypeFirstTimeLoad ? 1000 : 0;

        if (interactionLayer) {
            setTimeout(interactionLayer.play.bind(interactionLayer), timeoutDuration);
        }
    }
}


function visibleLayers() {
    var v = [];
    for (var framerLayer of framerLayers) {
        console.log(framerLayer.opacity);
        if (framerLayer.opacity > 0) {
            v.push(framerLayer);
        }
    }
    return v;
}


function resetMityaNamespace() {
    m = {};
}

function setupMityaShortcuts() {
    m.getLayer = getLayer;
    m.showScreen = showScreen;
    m.showScreenAtIndex = showScreenAtIndex;
    m.defaultAnimationDuration = 0.2;

    m.defaultAnimationForLayer_Property_Value = function (layer, property, value) {
        var propertyToAnimate = {};
        propertyToAnimate[property] = value;
        var animation = new Animation({
          layer: layer,
          properties: propertyToAnimate,
          time:m.defaultAnimationDuration
        });
        return animation;
    }

    m.scaleLayerToValue = function (layer, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, 'scale', value);
        animation.start();
    };

    m.moveXForLayerToValue = function (layer, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, 'x', value);
        animation.start();
    };

    m.moveYForLayerToValue = function (layer, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, 'y', value);
        animation.start();
    };

    m.moveLayerToValue = function (layer, x, y) {
        var xAnimation = m.defaultAnimationForLayer_Property_Value(layer, 'x', x);
        var yAnimation = m.defaultAnimationForLayer_Property_Value(layer, 'y', y);

        xAnimation.start();
        yAnimation.start();
    }

    m.fadeLayerToValue = function (layer, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, 'opacity', value);
        animation.start();
    }

    m.rotateLayerToValue = function (layer, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, 'rotation', value);
        animation.start();
    }


    m.setDefaultAnimationDuration = function (duration) {
        m.defaultAnimationDuration = duration;
    }

    m.animateLayerPropertyToValue = function (layer, property, value) {
        var animation = m.defaultAnimationForLayer_Property_Value(layer, property, value);
        animation.start();
    }

    m.animateLayerPropertyToValueInTimeWithDelay = function (layer, property, value, duration, delay) {
        var propertyToAnimate = {};
        propertyToAnimate[property] = value;
        var animation = new Animation({
          layer: layer,
          properties: propertyToAnimate,
          time:duration,
          delay:delay
        });
        animation.start();
    }

    m.animateLayerPropertyToValueInTime = function (layer, property, value, duration) {
        var propertyToAnimate = {};
        propertyToAnimate[property] = value;
        var animation = new Animation({
          layer: layer,
          properties: propertyToAnimate,
          time:duration,
          delay:0
        });
        animation.start();
    }
}
